00087     private void ShowOriginalFromGitOnClick(GitState localGitState, GitFile localGitFile)
00088     {
00089         if (localGitState.Repo is null)
00090             return;
00091             
00092         GitBackgroundTaskApi.Git.ShowFileEnqueue(
00093             localGitState.Repo,
00094             localGitFile.RelativePathString,
00095             (gitCliOutputParser, logFileContent) =>
00096             {
00097                 _createEditorsThrottle.Run(_ => { CreateEditorFromLog(gitCliOutputParser, localGitState, localGitFile, logFileContent); return Task.CompletedTask; });
00098                 return Task.CompletedTask;
00099             });
00100     }
