00102     private async Task<bool> TryCreateEditorIn(string logFileContent, ResourceUri originalResourceUri)
00103     {
00104         // Dispose any previously created state for the editor in model
00105         if (InResourceUri is not null)
00106         {
00107             TextEditorService.ModelApi.Dispose(InResourceUri.Value);
00108             InResourceUri = null;
00109         }
00110         
00111         // Create Model
00112         var resourceUri = new ResourceUri(ResourceUriFacts.Diff_ReservedResourceUri_Prefix + originalResourceUri.Value);
00113        InResourceUri = resourceUri;
00114        
00115         var fileLastWriteTime = DateTime.UtcNow;
00116         var content = logFileContent;
00117 
00118         var absolutePath = EnvironmentProvider.AbsolutePathFactory(resourceUri.Value, false);
00119         var decorationMapper = DecorationMapperRegistry.GetDecorationMapper(absolutePath.ExtensionNoPeriod);
00120         var compilerService = CompilerServiceRegistry.GetCompilerService(absolutePath.ExtensionNoPeriod);
00121 
00122         var model = new TextEditorModel(
00123             resourceUri,
00124             fileLastWriteTime,
00125             absolutePath.ExtensionNoPeriod,
00126             content,
00127             decorationMapper,
00128             compilerService);
00129             
00130         var modelModifier = new TextEditorModelModifier(model);
00131         modelModifier.PerformRegisterPresentationModelAction(CompilerServiceDiagnosticPresentationFacts.EmptyPresentationModel);
00132         modelModifier.PerformRegisterPresentationModelAction(FindOverlayPresentationFacts.EmptyPresentationModel);
00133         modelModifier.PerformRegisterPresentationModelAction(DiffPresentationFacts.EmptyInPresentationModel);
00134         
00135         model = modelModifier.ToModel();
00136 
00137         TextEditorService.ModelApi.RegisterCustom(model);
00138         
00139         model.CompilerService.RegisterResource(
00140             model.ResourceUri,
00141             shouldTriggerResourceWasModified: true);
00142             
00143         // Create ViewModel
00144         try
00145         {
00146             // Dispose any previously created state for the editor in view model
00147             TextEditorService.ViewModelApi.Dispose(InViewModelKey);
00148         
00149             var viewModelKey = InViewModelKey;
00150             var category = new Category("diff-in");
00151             
00152             var viewModel = new TextEditorViewModel(
00153                 viewModelKey,
00154                 resourceUri,
00155                 TextEditorService,
00156                 Dispatcher,
00157                 DialogService,
00158                 JsRuntime,
00159                 VirtualizationResult<List<RichCharacter>>.GetEmptyRichCharacters(),
00160                 new TextEditorDimensions(0, 0, 0, 0),
00161                 new ScrollbarDimensions(0, 0, 0, 0, 0),
00162                 new CharAndLineMeasurements(0, 0),
00163                 false,
00164                 category);
00165     
00166             var firstPresentationLayerKeys = new[]
00167             {
00168                 CompilerServiceDiagnosticPresentationFacts.PresentationKey,
00169                 FindOverlayPresentationFacts.PresentationKey,
00170                 DiffPresentationFacts.InPresentationKey,
00171             }.ToImmutableArray();
00172                 
00173             viewModel.UnsafeState.ShouldSetFocusAfterNextRender = false;
00174         
00175             viewModel = viewModel with
00176             {
00177                 GetTabDisplayNameFunc = _ => absolutePath.NameWithExtension,
00178                 FirstPresentationLayerKeysList = firstPresentationLayerKeys.ToImmutableList()
00179             };
00180             
00181             TextEditorService.ViewModelApi.Register(viewModel);
00182         }
00183         catch (Exception e)
00184         {
00185             NotificationHelper.DispatchError(
00186                 nameof(TryCreateEditorIn),
00187                 e.ToString(),
00188                 CommonComponentRenderers,
00189                 Dispatcher,
00190                 TimeSpan.FromSeconds(6));
00191         
00192             return false;        
00193         }
00194         
00195         return true;
00196     }
