00205 
00206             await TextEditorService.TextEditorConfig.RegisterModelFunc
00207                 .Invoke(registerModelArgs).ConfigureAwait(false);
00208         }
00209         
00210         // Create ViewModel
00211         try
00212         {
00213             // Dispose any previously created state for the editor out view model
00214             TextEditorService.ViewModelApi.Dispose(OutViewModelKey);
