00265     private async Task CreateEditorFromLog(
00266         GitCliOutputParser gitCliOutputParser,
00267         GitState localGitState,
00268         GitFile localGitFile,
00269         string logFileContent)
00270     {
00271         /*
00272         Goal: Diff Editor (2024-08-26)
00273         ==============================
00274         Log -> string
00275             -> Model (caching?)
00276                 -> new ResourceUri(ResourceUriFacts.Diff + originalResourceUri)
00277             -> ViewModel (caching?)
00278                    -> new Category("diff-in")
00279                 -> Add(DiffPresentationLayer)
00280         Actual -> string
00281                -> Model (more likely to already exist than the log's model?)
00282                -> ViewModel (caching?)
00283                    -> new Category("diff-out")
00284                     -> Add(DiffPresentationLayer)
00285         
00286         Previously I had been adding the diff presentation layer to the ViewModels of the category: "main".
00287         I think this diff presentation layer can and should be removed from ViewModels of the category: "main". 
00288         */
00289         
00290         TextEditorService.DiffApi.Register(
00291             _textEditorDiffModelKey,
00292             InViewModelKey,
00293             OutViewModelKey);
00294         
00295         _logFileContent = logFileContent;
00296         if (_logFileContent is null)
00297             return;
00298         
00299         var absolutePathStringStandardized = await TextEditorConfig.AbsolutePathStandardizeFunc.Invoke(
00300             localGitFile.AbsolutePath.Value,
00301             ServiceProvider);
00302             
00303         var originalResourceUri = new ResourceUri(absolutePathStringStandardized);
00304         
00305         if (!(await TryCreateEditorIn(logFileContent, originalResourceUri)))
00306             return;
00307             
00308         if (!(await TryCreateEditorOut(originalResourceUri, localGitFile.AbsolutePath)))
00309             return;
00310             
00311         GitBackgroundTaskApi.Git.DiffFileEnqueue(
00312             localGitState.Repo,
00313             localGitFile.RelativePathString,
00314             (gitCliOutputParser, logFileContent, plusMarkedLineIndexList) =>
00315             {
00316                 Console.WriteLine("DiffFileEnqueue");
00317                 
00318                 TextEditorService.PostUnique(
00319                     nameof(plusMarkedLineIndexList),
00320                     editContext =>
00321                     {
00322                         Console.WriteLine("plusMarkedLineIndexList");
00323                     
00324                         var originalResourceUri = new ResourceUri(localGitFile.AbsolutePath.Value);
00325                     
00326                         var modelModifier = editContext.GetModelModifier(originalResourceUri);
00327                         var viewModelModifier = editContext.GetViewModelModifier(OutViewModelKey);
00328                         
00329                         if (modelModifier is null || viewModelModifier is null)
00330                         {
00331                             Console.WriteLine("modelModifier is null || viewModelModifier is null");
00332                             return Task.CompletedTask;
00333                         }
00334                             
00335                         editContext.TextEditorService.ModelApi.StartPendingCalculatePresentationModel(
00336                             editContext,
00337                             modelModifier,
00338                             DiffPresentationFacts.OutPresentationKey,
00339                             DiffPresentationFacts.EmptyOutPresentationModel);
00340                             
00341                         var outPresentationModel = modelModifier.PresentationModelList.First(
00342                             x => x.TextEditorPresentationKey == DiffPresentationFacts.OutPresentationKey);
00343                             
00344                         if (outPresentationModel.PendingCalculation is null)
00345                         {
00346                             Console.WriteLine("outPresentationModel.PendingCalculation is null");
00347                             return Task.CompletedTask;
00348                         }
00349                         
00350                         var outText = outPresentationModel.PendingCalculation.ContentAtRequest;
00351                         
00352                         var outResultTextSpanList = new List<TextEditorTextSpan>();
00353                         
00354                         foreach (var lineIndex in plusMarkedLineIndexList)
00355                         {
00356                             
00357                             var lineInformation = modelModifier.GetLineInformation(lineIndex);
00358                             
00359                             Console.WriteLine($"lineIndex: {lineIndex} | ({lineInformation.StartPositionIndexInclusive} to {lineInformation.UpperLineEnd.StartPositionIndexInclusive})");
00360                             
00361                             outResultTextSpanList.Add(new TextEditorTextSpan(
00362                                 lineInformation.StartPositionIndexInclusive,
00363                                 lineInformation.UpperLineEnd.StartPositionIndexInclusive,
00364                                 (byte)TextEditorDiffDecorationKind.InsertionLine,
00365                                 originalResourceUri,
00366                                 outPresentationModel.PendingCalculation.ContentAtRequest));
00367                         }
00368                         
00369                         modelModifier.CompletePendingCalculatePresentationModel(
00370                             DiffPresentationFacts.OutPresentationKey,
00371                             DiffPresentationFacts.EmptyOutPresentationModel,
00372                             outResultTextSpanList.ToImmutableArray());
00373                         Console.WriteLine("modelModifier.CompletePendingCalculatePresentationModel");
00374                         
00375                         return Task.CompletedTask;
00376                     });
00377                     
00378                 return Task.CompletedTask;
00379             });
00380 
00381         await InvokeAsync(StateHasChanged);
00382     }
